-- Stored Procedure to insert data into a table variable\nCREATE PROCEDURE InsertDataIntoTableVariable @TableVar TABLE (ID INT, Name NVARCHAR(100))\nAS\nBEGIN\n    INSERT INTO @TableVar (ID, Name) VALUES (1, 'Jane Doe');\nEND;\n\n-- Main procedure using the table variable\nDECLARE @MyTableVar TABLE (ID INT, Name NVARCHAR(100));\nEXEC InsertDataIntoTableVariable @MyTableVar OUTPUT;\nSELECT * FROM @MyTableVar;